import React from 'react'
import logo from '../src/images/Vector-Smart-Object11.png'
import './header.css'
import {Link} from 'react-router-dom'



function header() {
 
  function get(){
     document.getElementById("home")
     document.getElementById("abtt")
     document.getElementById("ser")
     document.getElementById("cont")
     
    if ("home"&&"abtt"&&"ser"&&"cont") {
      document.getElementById("home").style.webkitTextFillColor="white"
      document.getElementById("abtt").style.webkitTextFillColor="red"
      document.getElementById("ser").style.webkitTextFillColor="green"
      document.getElementById("cont").style.webkitTextFillColor="black"
    } else{
      
    }
   
  
  } 
  do {
    document.getElementById("cont").style.webkitTextFillColor="white"
  } while ("cont".l);

  



  return (
    <div className='navbar'>

     <div className='logo'>
     <img src={logo} className='image-logo' alt=''></img>
     </div>
     <div className='nav-text'>
      
        <Link className='link-header' to ='/'>        <p onClick={get} id='home' className='navtexts'>HOME</p></Link>
        <Link className='link-header'  to='/aboutus'> <p onClick={get} id='abtt' className='navtexts'>ABOUT</p></Link>
        <Link className='link-header' to ='/services'><p onClick={get} id='ser' className='navtexts'>SERVICES</p></Link>
        <Link className='link-header' to='/contactus'><p onClick={get} id='cont'  className='navtexts'>CONTACT US</p></Link>
        
        
        </div>
  
       
       </div>
  
   
  

  )
}

export default header
